import React from 'react';
import imgToAscii from '../../util/imgToAscii';

const image = () => {
    let img = new imgToAscii('../../testImg.jpg');
    return img;
}

function ImageToAsciiContainer() {
    return(
    <div className="ascii-image-container">
        <img src={image()}></img>
    </div>
    );
}

export default ImageToAsciiContainer;
